import { IMAGES } from '../constants'

 const loadImages = () => ({
    type:'IMAGES.LOAD'
});

 const images = images => ({
    type:'IMAGES.LOAD_SUCCESS',
    images,
});

 const setError = error => ({
    type: 'IMAGES.LOAD_FAIL',
    error,
});

export  { loadImages, images, setError }
